import React from "react";
import "./Discriptionbox.css";
const Discriptionbox = () => {
  return (
    <div className="discriptionbox">
      <div className="discriptionbox-navigator">
        <div className="discriptionbox-navbox">Discription </div>
        <div className="discriptionbox-navbox-fade">reviews (1224)</div>
      </div>
      <div className="discriptionbox-discription"></div>
    </div>
  );
};

export default Discriptionbox;
